            <div className="outterdiv">
                <div className="inner">
                    <h1>
                        Restaurants in <br /> your pocket
                    </h1>
                    <p>
                        Order from your favorite restaurants &amp; track on the go, with the all-new Swiggy app.
                    </p>
                    <div className="buttons">

